import React, { Component } from "react";
import { Link } from "react-router-dom";
import {
  Badge,
  BreadcrumbItem,
  Breadcrumb,
  Container,
  Sidebar
} from "reactstrap";
class Header extends Component {
  render() {
    return (
      <div class="ui inverted segment">
        <div class="ui inverted secondary pointing menu">
          <Link class="active item" to="/">
            Home
          </Link>
          <Link class="item" to="/items">
            Items
          </Link>
          <Link class="item" to="/units">
            Units
          </Link>
          <Link class="item" to="/transactions">
            Transactions
          </Link>
          <Link class="item" to="/stocks">
            Stocks
          </Link>
        </div>
      </div>
    );
  }
}

export default Header;
